import Johnny from "./Johnny"

function Welcome() {
  return (
    <div style={{ color: "white" }}>
      <h1>Welcome to Dan's Movie Database!</h1>
      <h2>Feel free to have a look around.</h2>
      <h3>You can search movies and TV shows.</h3>
      <Johnny />
    </div>
  )
}

export default Welcome
